  return (

    <div className='app-container'>
      <NavBar/>
      <div className='main-container'>
        <Routes>
          <Route path='/'element={<CodeNav  />} />
            <Route path='/editor/:id'
            element={<Editor 
              projectName = "loading..."
              code = {code}
              onChange = {setCode}
